import React, { useState } from "react";
import { Navbar, Propertycard } from "../../conponents";
import Propertycardbudget from "../../conponents/budgetmeter/Propertycardbudget";

import "./About.css";

const About = () => {
  const [budget,setbudget] = useState();
  function handleB(e){
    const nd = { ...budget };
    nd[e.target.name] = e.target.value;
    setbudget(nd);
    console.log(budget)
  }
  return (
    <>
    <Navbar />
      <div className="About-main">
        <input  placeholder="Enter budget"   ></input>
        <div className="main-hub"><Propertycardbudget/></div>
        
      </div>
    </>
  );
};

export default About;
